import React from "react"
//import Matter from "matter-js"

const Scene = (props) => {

  const styles = {
    display: props.display ? "block" : "none",
    top: 50,
    height: 'calc(100% - 50px)',
    background:"red",
    width: '100vw',
    position: 'fixed'
  }

  return (
    <div style={styles}>
      
     </div>
    
  )
}

export default Scene;
